        this.webApiService = webApiService;
        this.route = route;
        this.httpProvider = httpProvider;
        this.modalService = modalService;
        this.tableDetail = [];
        this.tableList = [];
    }
    reload() {
        this.gettableDetailByName();
    }
    ngOnInit() {
        this.tableName = this.route.snapshot.queryParams['table'];
        this.gettableDetailByName();
    }
    async gettableDetailByName() {
        this.webApiService.get('api/table/' + this.tableName).subscribe(data => {
            if (data !== undefined) {
                console.log(this.tableName);
                console.log(data.body);
            }
            this.tableList = data.body;
        });
    }
};
